import { Component } from 'react';
import './About.css';
import image from "./Profile Pic.jpg"

class About extends Component {
  skills_and_technologies = ["React", "JavaScript", "CSS3", "HTML5", "Node.js", "Git"]
  render() {
    return (
      <div className="about-section">
        <h3 className="about-title">About Me</h3>

        <div className="about-content">
          <div className="photo-card">
            <img src={image} className="image" />
          </div>

          <div className="info-block">
            <p>Hello! I'm Joseph Gonzales. I'm a senior majoring in Computer Science at New Jersey Institute of Technology.</p>
            <p>With a background in computer science and a keen eye for design,
              I strive to bridge the gap between functionality and aesthetics in every project I work on.</p>

            <div className="skills-technologies-block">
              <h4 className="skills-technologies-header">Skills & Technologies</h4>
              <div className="skills-technologies-row">
                {this.skills_and_technologies.map(skill_or_technology =>
                  <span className="skills-technologies">{skill_or_technology}</span>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default About;
